supply__supply_curve_details:
Chiliz' token generation was executed via Private Placement only and completed in 2018 with its hard cap reached. No more tokens will be generated.

Burning mechanism of CHZ: 
20% of the Net Trading Fees of Chiliz.net Exchange collected in $CHZ will be burnt; 
10% of the Net Proceed of the Fan Token Offering (FTOs) from Chiliz.net platform collected in $CHZ will be burnt + 3 months lock on collected $CHZ; 
20% of the Net Proceed of NFT & Collectibles issued by $CHZ will be burnt. So far 47 million CHZ have been burned.

general__launch_details:
There will only ever be 10,000,000 BOND tokens. Distribution of these tokens will take place mostly over a 2-3 year period starting in October of 2020. Token distribution breakdown:
68% Community;
12.5% Core Team;
7.5% Investors;
6% DAO Treasury;
4% Multi Sig;
2% Advisors.
